import React from "react";
import Project from "./Project";

const ProjectList = () => {
  const projects = [
    {
      title: "Video service",
      image: "/public/images/projects/01-thumb.jpg",
      imageAlt: "Video service",
      copy: "Bla bla dasdaasds dqweqedqw. Bla bla dasdaasds dqweqedqw. Bla bla dasdaasds dqweqedqw"
    },
  ]

  return (
    <div className="main__wrapper">
      {projects.map((project, index) => (
        <Project
          key={index}
          title={project.title}
          image={project.image}
          imageAlt={project.imageAlt}
          copy={project.copy}
        />
      ))}
    </div>
  )

}

export default ProjectList;
